import React from 'react';
import { Link } from 'react-router-dom';

import './NavToProdBtn.css';

interface Props {
  link: string;
  imgSrc: string;
  alt: string;
}

export const NavToProdBtn = (props: Props) => {
  const {link, imgSrc, alt} = props;
	return (
    <Link to={link}>
      <button className="nav-to-prod-btn">
        <img className="nav-to-prod-btn__img" src={imgSrc} alt={alt}/> 
      </button>
    </Link>
  )
}
